var m_modal = (function () {
    function init() {
        openModal();
        closeModal();
    }

    function openModal() {
        $("body").on("click","[data-modal='true']",function(){
            var modalId = ($(this).attr('href')==="") ? $(this).attr('data-target') : $(this).attr('href');
            TweenMax.to($(modalId), 0.5, {
                autoAlpha: 1,
                display: 'block',
                onComplete: function() {
                    if (!Utils.isMobile.any()) {
                        $('html').removeClass('forceScrollY').addClass('is-modal-open');
                    }
                }
            });
            return false;
        });
    }


    function closeModal() {
        $("body").on("click","[data-closeModal='true']",function(){
            var $monModal = $(this).closest('.m-modal');
            $('html').removeClass('is-modal-open');

            //si iframe, reset la source pour éviter que le son joue
            var $monModal = $(this).closest('.m-modal');
            var $monFrame = $monModal.find('iframe');
            var srcActuelle=$monFrame.attr("src");
            $monFrame.attr("src",srcActuelle);

            TweenMax.to($monModal, 0.5, {
                autoAlpha: 0,
                display: 'none',
                onComplete: function() {

                }
            });
            return false;
        });
    }


    // Reveal public pointers to1
    // private functions and properties
    return {
        init: init
    };
})();

$('document').ready(function(){
    m_modal.init();
});
//applique une couleur de branding en fonction de la couleur dominante d'une image
var imgSwitchColor=[];
var m_switchColor = (function () {
    
    function init(){
        $('.is-switch-color').each(function(){
            var $element=$(this);
            var imgId=$element.attr('data-switchColorIdImg');
            var cssProperty=$element.attr('data-switchColorCssProperty');
            if ($("#"+imgId).length>=1){
                    //si ce colorThief est deja en cours
                    if (!verifColorThiefDejaFait(imgId)){
                         
                        $.when(colorThief($("#"+imgId).attr('src'))).done(function(rgb) {
                            var color = tinycolor("rgb("+rgb[0]+","+rgb[1]+","+rgb[2]+")");
                            var hsl=color.toHsl();
                            var dominantColorHex=color.toHexString();
                            var brandColor=determineBrandColor(hsl.h);
                            var disabledColor=determineBrandColorDisabled(hsl.h);

                            for ( var i=0 ; i < imgSwitchColor.length; i++) {
                                var elementCourant=imgSwitchColor[i];
                                var $elementCourant=elementCourant.element;
                                var $textElement=$($elementCourant.attr('data-switchColorTextElement'));
                                var colorType=$elementCourant.attr('data-switchColorType');

                                if (elementCourant.imgID===imgId){
                                    modifierCouleur(elementCourant.element,elementCourant.cssProperty,dominantColorHex,brandColor,disabledColor,colorType,$textElement);
                                }
                            }
                        });
                    }
               
                var imgSwitchColorArray={"imgID":imgId,"element":$element,"cssProperty":cssProperty};
                imgSwitchColor.push(imgSwitchColorArray);
            }else{
                //si l'image ne load pas -> jaune
                var $textElement=$($element.attr('data-switchColorTextElement'));
                modifierCouleur($element,cssProperty,'#ffd100','#ffd100','brandColor',$textElement);
            }
        });
    }



    function verifColorThiefDejaFait(imgId){
        var retour=false;
        for ( var i=0 ; i < imgSwitchColor.length; i++) {
            var elementCourant=imgSwitchColor[i];
            if (elementCourant.imgID===imgId){
                retour=true;
            }
        }
        return retour;
    }

    function modifierCouleur($element,cssProperty,dominantColor,brandColor,disabledColor,colorType,$textElement){
        var maCouleur=brandColor;
        var textColor = getContrast(brandColor.replace('#',''));

        if (colorType==="dominantColor"){
            maCouleur=dominantColor;
            textColor = getContrast(dominantColor.replace('#',''));
        }else if (colorType==="brandColorDisabled"){
            maCouleur=disabledColor;
            //se fie à la couleur de branding standard pour déterminer la couleur du texte
            textColor = getContrast(brandColor.replace('#',''));
        }

        var arraySplit = cssProperty.split(',');
        for(var i = 0; i < arraySplit.length; i++){
            if (arraySplit[i]==="background-color" || arraySplit[i]==="background"){
                $element.css("color",textColor);
            }
            if ($textElement){
                $textElement.css("color",textColor);
            }
            $element.css(arraySplit[i],maCouleur);

            //car le removeClass ne fonctionne pas sur les path svg
            var currentClass=$element.attr('class');
            var newClass=currentClass.replace('invisible','');
            $element.attr('class',newClass);
        }
    }

    function colorThief(imgLink) {
        var r = $.Deferred();
        var rgb=[255,218,21]; //jaune par défaut
        var img = document.createElement('img');
        img.onload = function(e) {
            try {
              //facon de loader standard pour les browser moderne 
              var colorThief = new ColorThief();
              rgb=colorThief.getColor(img);
              r.resolve(rgb);
            } catch (e) {
                //avec preload.js pour ie10 a cause du cross browser
              $.getScript(preloadJsLink, function( data, textStatus, jqxhr ) {
                var preload = new createjs.LoadQueue();
                preload.addEventListener("fileload", handleFileComplete);
                preload.loadFile(imgLink);
                function handleFileComplete(event) {
                    event.result.crossOrigin='anonymus';
                    var colorThief = new ColorThief();
                    try {
                    rgb=colorThief.getColor(event.result,5);
                    r.resolve(rgb);
                    } catch (e) {
                    //sinon jaune
                      r.resolve(rgb);
                    }
                }
              })
            };
        };
        img.onerror = function(){
        r.resolve(rgb); //jaune
        }
        img.crossOrigin = '';
        img.src = imgLink;
      
      return r;
    }

    function determineBrandColor(hslH){
        var colorBranding="#FF5C39"; //orange
        if(hslH>30 && hslH<=57){
            colorBranding="#FFD100"; //jaune
        }else if(hslH>57 && hslH<=120.5){
            colorBranding="#C4D600"; //vert
        }else if(hslH>120.5 && hslH<=188){
            colorBranding="#00BFB3"; //turquoise
        }else if(hslH>188 && hslH<=244.5){
            colorBranding="#0085CA"; //bleu
        }else if(hslH>244.5 && hslH<=317.5){
            colorBranding="#87319A"; //mauve
        }else if(hslH>317.5 && hslH<=356){
            colorBranding="#F6416C"; //rose
        }else if (hslH>356 || hslH<=6){
            colorBranding="#E31D1A"; //rouge
        }
        return colorBranding;
    }

    function determineBrandColorDisabled(hslH){
        var colorDisabled="#90574b"; //orange
        if(hslH>30 && hslH<=57){
            colorDisabled="#86762d"; //jaune
        }else if(hslH>57 && hslH<=120.5){
            colorDisabled="#6a7025"; //vert
        }else if(hslH>120.5 && hslH<=188){
            colorDisabled="#216460"; //turquoise
        }else if(hslH>188 && hslH<=244.5){
            colorDisabled="#23516a"; //bleu
        }else if(hslH>244.5 && hslH<=317.5){
            colorDisabled="#523459"; //mauve
        }else if(hslH>317.5 && hslH<=356){
            colorDisabled="#8d4e5d"; //rose
        }else if (hslH>356 || hslH<=6){
            colorDisabled="#7b3635"; //rouge
        }
        return colorDisabled;
    }

    function getContrast(hexcolor) {
        var color = tinycolor('#'+hexcolor);
        var monRgb=color.toRgb();
        var o = Math.round(((parseInt(monRgb.r) * 299) + (parseInt(monRgb.g) * 587) + (parseInt(monRgb.b) * 114)) /1000);
        var textColor= "white";
        if(o > 125) {
            textColor= "black";
        }
        return  textColor;
    }



    // Reveal public pointers to
    // private functions and properties
    return {
        init: init,
    };
})();

$('document').ready(function(){
    m_switchColor.init();
});
var norm_add_to_playlist = (function () {

    function init() {
        $(document).on('click', '.watchLater', function(event) {
            event.preventDefault();
            var $thumbnail = $(this).closest('.vignette');
            var clickOrigin, movieTitle;
            if ($thumbnail.length > 0) {
                clickOrigin = 'thumbnail';
                movieTitle = $thumbnail.find('.titre').text().trim();
            }
            else {
                clickOrigin = 'film-page';
                movieTitle = $('#titleHeader').text().trim();
            }
            $(".watchLater").modalFormSubmitJSON({
                href: "/partial/playlist/film/add/" + $(this).data("source-id"),
                clickOrigin: clickOrigin,
                movieTitle: movieTitle
            });
        });

        $("body").on('click','#createNewPlaylist',function(){
            $("#createNewPlaylist").hide();
            $("#newplaylist").removeClass( "hidden" );
            $('#isnewlist').val('True');
            $('#form_add_film_to_playlist').data('formValidation')
              .enableFieldValidators('pl', false)
              .enableFieldValidators('newplaylist', true);

            //Réinitialise le dropdown des sélections déjà créer
            $('select[name=pl]').val(0);
            $('#pl_list').selectpicker('refresh');
        });

        $.fn.modalFormSubmitJSON = function(args, callback) {
            var onclosed = function(){};
            var serialized = {};
            var lang = $('html').attr('lang');

            if (args.onClosed != 'undefined'){ onclosed = args.onClosed}

            if (args.form != ''){serialized = $("#"+args.form).serialize();}

            if (args.send_type == "post"){
                var theURL = $("#"+args.form).attr("action");
                $.post(theURL, serialized, function(data){
                    $.colorbox({open : true, html : data.html, fixed:true, onClosed:onclosed}, callback);
                }, "json");
            } else {
                $.getJSON(args.href, serialized, function(data){
                    if (args.target_div != undefined){ //if a target is set, put html there.
                        $(args.target_div).html(data.html);
                    }
                    else { //if a target is not set, put html in modal
                        $.colorbox({open : true, html : data.html, fixed:true, width: 360, onComplete:function(){

                            $('#pl_list').selectpicker({mobile: Utils.isMobile.any()}).change(function () {
                                var selected = $(this).find("option:selected").val();
                                //ferme les nouvelles sélections
                                if (selected!=""){
                                  $('#isnewlist').val('False');
                                  $("#createNewPlaylist").show();
                                  $("#newplaylist").val('').addClass( "hidden" );
                                  $('#form_add_film_to_playlist').data('formValidation')
                                    .enableFieldValidators('pl', true)
                                    .enableFieldValidators('newplaylist', false);
                                }
                            });

                            var localValidation=['en_US'];
                            if (lang == 'fr'){
                                localValidation=['fr_FR'];
                            }
                            var $serveurErrorInContext=$('.server-error-in-context');
                            $(".validationPlaylist").formValidation({
                                feedbackIcons: {
                                    valid: 'glyphicon glyphicon-ok',
                                    invalid: 'glyphicon glyphicon-remove',
                                    validating: 'glyphicon glyphicon-refresh'
                                },
                                fields: {
                                  pl: {
                                    validators: {
                                      notEmpty: {
                                        enabled: true,
                                        // TODO(ARS): Temporary hotfix before testing due to rebase issues.
                                        message: typeof addToPlaylistValidationMessages === "undefined" ?
                                                    "" : addToPlaylistValidationMessages['selectPlaylist'],
                                      }
                                    }
                                  },
                                  newplaylist: {
                                    validators: {
                                      notEmpty: {
                                        enabled: !$('#newplaylist').hasClass('hidden')
                                      }
                                    }
                                  }
                                },
                                locale: localValidation,
                                submitButtons: 'button[type="submit"]',
                                excluded:[':disabled'],
                                verbose: false,
                            }).on('err.validator.fv', function() {
                                $serveurErrorInContext.remove();
                                $.fn.colorbox.resize({});
                            }).on('success.validator.fv', function(e, data) {
                                $serveurErrorInContext.remove();
                            }).on('success.form.fv', function(e) {
                                // Prevent form submission
                                e.preventDefault();
                                //si c'est un chapitre
                                if($(".validationPlaylist").attr('data-type')=="chapters"){
                                    if ( $('#isnewlist').val()=="True" ) {
                                        playlist = new PlayListAjax($('#newplaylist').val(), chapterLang);
                                        playlist.create(function(data){
                                            chapters.save(data.slug, modalCallback, modalCallback)
                                        });
                                    }
                                    else if ($('#pl_list').val() != "") {
                                        chapters.save($('#pl_list').val(), modalCallback, modalCallback);
                                    }
                                }
                                //si c'est un film
                                else{
                                    $.fn.modalFormSubmitJSON({href:playlistUrl, form: 'form_add_film_to_playlist', send_type:'post'});
                                }

                                if (args.movieTitle && args.clickOrigin) {
                                    // Track analytics event
                                    var userType = userHasCampusAccess ? 'campus' : 'regular';
                                    var label = 'add ' + args.movieTitle + ' ' + args.clickOrigin + ' ' + userType;
                                    _gaq.push(['_trackEvent', 'UI-UX', 'add-to-playlist', label]);
                                }
                            });

                        }}, callback);
                    }
                });
            }
        };
    }

    //affiche le message de succès de l'ajout de chapitre
    var modalCallback = function(data){
        var html_msg = getHtmlResponseFromResponse(data.responseText);
        $.colorbox({ open: true,  html : html_msg, width:380 });
    };




    // Reveal public pointers to
    // private functions and properties
    return {
        init: init,
    };
})();

$('document').ready(norm_add_to_playlist.init);

//Permet de collapser des div comme les crédits de films
var sf_collapseBlock = (function () {
    function init() {
        $("body").on("click",".collapseBlock",function() {

            var $title = $(this);
            var $allTitleInBlock = $title.closest('.collapseBlockContainer').find('.collapseBlock');
            var $containerCollapse = $title.next();
            if ($title.attr('data-block')){
                $containerCollapse = $("#"+$title.attr('data-block'));
            }
            var isMasonry = $containerCollapse.attr('data-isMasonry');
            if (!$allTitleInBlock.hasClass('is-animated')) {
                $allTitleInBlock.addClass('is-animated');
                if (!$title.hasClass('is-collapseBlock-open')) {
                    $title.addClass('is-collapseBlock-open');
                    if ($title.closest('.collapseBlockContainer').length > 0){
                        $title.closest('.collapseBlockContainer').find('.collapseBlock').addClass('is-collapseBlock-open');
                    }

                    if (isMasonry) {
                        $containerCollapse.removeClass('is-masonry').hide();
                    }
                    $containerCollapse.slideDown(function() {
                        $allTitleInBlock.removeClass('is-animated');
                    });
                } else {
                    $title.removeClass('is-collapseBlock-open');
                    if ($title.closest('.collapseBlockContainer').length > 0){
                        $title.closest('.collapseBlockContainer').find('.is-collapseBlock-open').removeClass('is-collapseBlock-open');
                    }
                    $containerCollapse.slideUp(function() {
                        if (isMasonry) {
                            $containerCollapse.addClass('is-masonry').show();
                        }
                        $allTitleInBlock.removeClass('is-animated');
                    });
                }
            }
            return false;
        });
    }



    // Reveal public pointers to1
    // private functions and properties
    return {
        init: init
    };
})();

